import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom'; // Import Routes and Navigate for v6
import './App.css';

// Dashboard Component (Unchanged)
const Dashboard = ({ products, onLogout }) => {
    const totalProducts = products.length;
    const totalStock = products.reduce((sum, product) => sum + product.quantity, 0);

    return (
        <div className="dashboard">
            <h1>Dashboard</h1>
            <button onClick={onLogout} className="form-button logout-button">Logout</button>
            <div className="dashboard-stats">
                <div>Total Products: {totalProducts}</div>
                <div>Total Stock: {totalStock}</div>
            </div>

            <h2>Stock Overview</h2>
            <table className="styled-table">
                <thead>
                    <tr>
                        <th>Product</th>
                        <th>Category</th>
                        <th>Stock</th>
                    </tr>
                </thead>
                <tbody>
                    {products.map((product) => (
                        <tr key={product.id}>
                            <td>{product.name}</td>
                            <td>{product.category}</td>
                            <td>{product.quantity}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

// Product Management Component (Unchanged)
const ProductManagement = ({ products, setProducts }) => {
    const [formData, setFormData] = useState({ name: '', category: '', quantity: 0, price: 0 });

    const handleSubmit = (e) => {
        e.preventDefault();
        if (formData.id) {
            const updatedProducts = products.map((product) =>
                product.id === formData.id ? formData : product
            );
            setProducts(updatedProducts);
        } else {
            setProducts([...products, { ...formData, id: Date.now() }]);
        }
        setFormData({ name: '', category: '', quantity: 0, price: 0 });
    };

    const handleDelete = (id) => {
        setProducts(products.filter((product) => product.id !== id));
    };

    return (
        <div className="product-management">
            <h2>Product Management</h2>
            <form onSubmit={handleSubmit} className="styled-form">
                <input
                    type="text"
                    placeholder="Name"
                    value={formData.name}
                    onChange={(e) => setFormData({ ...formData, name: e.target.value })}
                    required
                />
                <input
                    type="text"
                    placeholder="Category"
                    value={formData.category}
                    onChange={(e) => setFormData({ ...formData, category: e.target.value })}
                    required
                />
                <input
                    type="number"
                    placeholder="Quantity"
                    value={formData.quantity}
                    onChange={(e) => setFormData({ ...formData, quantity: parseInt(e.target.value) })}
                    required
                />
                <input
                    type="number"
                    placeholder="Price"
                    value={formData.price}
                    onChange={(e) => setFormData({ ...formData, price: parseFloat(e.target.value) })}
                    required
                />
                <button type="submit" className="form-button">
                    {formData.id ? 'Update' : 'Add'} Product
                </button>
            </form>

            <ul className="product-list">
                {products.map((product) => (
                    <li key={product.id}>
                        {product.name} - {product.category} - {product.quantity} in stock
                        <button onClick={() => setFormData(product)} className="edit-button">Edit</button>
                        <button onClick={() => handleDelete(product.id)} className="delete-button">Delete</button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

// User Management (Login) Component (Unchanged)
const UserManagement = ({ onLogin }) => {
    const [loginData, setLoginData] = useState({ username: '', email: '' });

    const handleLogin = (e) => {
        e.preventDefault();
        onLogin(); // Login without checking credentials
        setLoginData({ username: '', email: '' });
    };

    return (
        <div className="user-management">
            <h1 className="app-heading">Limkokwing Wings Cafe </h1>
            <h2>User Login</h2>
            <form onSubmit={handleLogin} className="styled-form">
                <input
                    type="text"
                    placeholder="Username"
                    value={loginData.username}
                    onChange={(e) => setLoginData({ ...loginData, username: e.target.value })}
                    required
                />
                <input
                    type="email"
                    placeholder="Email"
                    value={loginData.email}
                    onChange={(e) => setLoginData({ ...loginData, email: e.target.value })}
                    required
                />
                <button type="submit" className="form-button">Login</button>
            </form>
        </div>
    );
};

// Main App Component with Routing
const App = () => {
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [products, setProducts] = useState([
        { id: 1, name: 'Chicken Wings', category: 'Food', quantity: 50, price: 10 },
        { id: 2, name: 'Soda', category: 'Beverage', quantity: 100, price: 1.5 },
    ]);

    const handleLogin = () => {
        setIsAuthenticated(true); // Redirect to Product Management after login
    };

    const handleLogout = () => {
        setIsAuthenticated(false); // Redirect back to login on logout
    };

    return (
        <Router>
            <div>
                <nav className="navigation">
                    {isAuthenticated && (
                        <>
                            <Link to="/dashboard" className="nav-button">Dashboard</Link>
                            <Link to="/products" className="nav-button">Product Management</Link>
                            <button onClick={handleLogout} className="nav-button">Logout</button>
                        </>
                    )}
                </nav>

                <Routes>
                    <Route path="/login" element={isAuthenticated ? <Navigate to="/products" /> : <UserManagement onLogin={handleLogin} />} />
                    <Route path="/products" element={isAuthenticated ? <ProductManagement products={products} setProducts={setProducts} /> : <Navigate to="/login" />} />
                    <Route path="/dashboard" element={isAuthenticated ? <Dashboard products={products} onLogout={handleLogout} /> : <Navigate to="/login" />} />
                    <Route path="/" element={<Navigate to="/login" />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
